В популяционной генетике человека гаплогруппой N называют одну из гаплогрупп, выявленных при анализе последовательности митохондриальной ДНК (mtDNA). Это необыкновенно широко распространённая гаплогруппа, носители её субклад живут на нескольких континентах, поэтому её называют макро-гаплогруппой. В свою очередь, макрогруппа N сама представляет собой одну из ветвей гаплогруппы L3, от которой она отделилась в западной части Азии 50—80 тыс. лет назад. TMRCA для базальной неафриканской гаплогруппы N составляет около 51 тыс. лет (95% доверительный интервал: 55,1—46,9 тыс. лет). Предковая гаплогруппа L3, в свою очередь, происходит от потомков гипотетической митохондриальной Евы из Африки. Стивен Оппенгеймер предложил для макрогруппы N название клан Насрин, а Брайн Сайкс — Наоми. От гаплогруппы N происходят почти все гаплогруппы Европы, Океании, а также носителей индейских и многих азиатских языков. Она образовалась в западной части Азии приблизительно в то же время, когда и другая широко распространенная макрогруппа М. Обе в небольшом количестве встречаются в районе Африканского Рога, куда были привнесены в результате обратной миграции их носителей около 30 тыс. лет назад. Субгаплогруппа N9b существует на относительно высокой частоте в популяциях Юго-Восточной Сибири: удэгейцы — 30,4%, ульчи — 6,9% (Стариковская и др., 2005). От макрогруппы N происходят другие широко распространенные макрогруппы: A, N1, R, I, S, W, X, Y. Из них: 
* Субклада N* была обнаружена у представителей культуры кардиальной керамики. 
* гаплогруппа А обнаружена в Центральной и восточной Азии, а также среди американских индейцев; 
* гаплогруппа R — предок ряда распространенных групп, B, F, JT, P, а также HV, К и U, широко представленных в Европе; 
* гаплогруппа S обнаружена у австралийских аборигенов; 
* гаплогруппа W распространена преимущественно на западе Евразии; 
* гаплогруппа X1 обнаружена в Северной Африке, а гаплогруппа X2 — в Европе, Сибири и Америке; 
* гаплогруппа Y распространена среди нивхов и айнов, а также, в небольшом количестве, среди корейцев, монголов, коряков, ительменов, китайцев, японцев, жителей Малайского архипелага и некоторых тюркских народов.
